export default class Est{
    constructor(name, sname, cpf, email, bday, tel, telc, nomeResp, telResp, emailResp, cep, end, cidade)
    {
        this.name=name;
        this.sname=sname;
        this.cpf=cpf;
        this.email=email;
        this.bday=bday;
        this.tel=tel;
        this.telc=telc;
        this.nomeResp=nomeResp;
        this.telResp=telResp;
        this.emailResp=emailResp;
        this.cep=cep;
        this.end=end;
        this.cidade=cidade;
    }

}
